import  Axios  from "axios"
import React, { useEffect, useState } from "react"
import './RadarForm.css';
import axios from "axios";
import DataTable from "react-data-table-component";
import { Alert } from "bootstrap";

const RadarHome = (props) => {

    const [RadarData, setRadarData] = useState([]);
    const [RadarUpdate, setRadarUpdate] = useState([]);
    const [statusRadio, setStatusRadio] = useState(1);
    const [id, setId] = useState(0);
    const [status, setStatus] = useState("Saved");
    const [lastSend, setLastSend] = useState("-");
    const [time, setTime] = useState("Time");
    const [trackMode, setTrackMode] = useState("");
    const [environment, setEnvironment] = useState("Environment");
    const [course, setCourse] = useState(0);
    const [speed, setSpeed] = useState(0);
    const [courseRangeMin, setCourseRangeMin] = useState(0);
    const [courseRangeMax, setCourseRangeMax] = useState(0);
    const [courseIncrement, setCourseIncrement] = useState(0);
    const [latitude, setLatitude] = useState(0);
    const [bearing, setBearing] = useState(0);
    const [mode1code, setMode1Code] = useState(0);
    const [mode2code, setMode2Code] = useState(0);
    const [trackInput, setTrackInput] = useState("");
    const [startTime, setStartTime] = useState("-");
    const [speedRangeMin, setSpeedRangeMin] = useState(0);
    const [speedRangeMax, setSpeedRangeMax] = useState(0);
    const [speedIncrement, setSpeedIncrement] = useState(0);
    const [longitude, setLongitude] = useState(0);
    const [distance, setDistance] = useState(0);
    const [mode3code, setMode3Code] = useState(0);
    const [mode4code, setMode4Code] = useState(0);
    const [count, setCount] = useState(0);
    const [endTime, setEndTime] = useState("-");
    const [altitudeRangeMin, setAltitudeRangeMin] = useState(0);
    const [altitudeRangeMax, setAltitudeRangeMax] = useState(0);
    const [altitudeIncrement, setAltitudeIncrement] = useState(0);
    const [altitude, setAltitude] = useState(0);
    const [mode5code, setMode5Code] = useState(0);
    const checkIdSend=[];
    const checkIdDelete=[];
    const [message, setMessage] = useState("");

    const kolom = [
      {
        name: 'ID',
        selector: row => row.id,
        sortable: true
      },
      {
        name: 'Track Input',
        selector: row => row.trackInput,
        sortable: true
      },
      {
        name: 'Track Mode',
        selector: row => row.trackMode,
        sortable: true
      },
      {
        name: 'Environtment',
        selector: row => row.environtment,
        sortable: true
      },
      {
        name: 'Start Time',
        selector: row => row.startTime,
        sortable: true
      },
      {
        name: 'End Time',
        selector: row => row.endTime,
        sortable: true
      }
    ]

    // Handler Radio 1
    let handlerRadio1 = async (e) => {
        setStatusRadio(1)
    };

    //// Handler Radio 2
    let handlerRadio2 = async (e) => {
        setStatusRadio(2)
    };

    //// Request Get Radar Track Data
    const getRadarData = async () => {
        try{
        const response = await Axios.get('http://localhost:8080/radar');
        setRadarData(response.data)
        } catch(e){
        console.log(e.message)
        }
    }

    useEffect(() => {
            getRadarData();
    }, [])

    //Function Request POST Save Data Radar Track
    let dataSave = async (e) => {
        let resSend= await fetch("http://localhost:8080/radar", {
            method: "POST",
            body: JSON.stringify({
            status: status,
            lastSend: lastSend,
            count:count,
            time:time,
            trackInput:trackInput,
            course:course,
            speed:speed,
            trackMode: trackMode,
            environment: environment,
            courseRangeMin:courseRangeMin,
            courseRangeMax:courseRangeMax,
            courseIncrement:courseIncrement,
            latitude:latitude,
            bearing:bearing,
            mode1code:mode1code,
            mode2code:mode2code,
            startTime:startTime,
            speedRangeMin:speedRangeMin,
            speedRangeMax:speedRangeMax,
            speedIncrement:speedIncrement,
            longitude:longitude,
            distance:distance,
            mode3code:mode3code,
            mode4code:mode4code,
            endTime:endTime,
            altitudeRangeMin:altitudeRangeMin,
            altitudeRangeMax:altitudeRangeMax,
            altitudeIncrement:altitudeIncrement,
            altitude:altitude,
            mode5code:mode5code

        }),
            headers: {
                'Content-type': 'application/json; charset=UTF-8',
            },               
        });
    }

    // Handle Save Radar Track
    let handlerSaveTrack = async (e) => {
        e.preventDefault();
        try {
            if(trackInput === "multi" && trackMode == "Manual"){
                for (let step = 0; step < count; step++) {
                    dataSave();
                }
            } else if(trackInput === "multi" && trackMode == "Automatic"){
                for (let step = 0; step < count; step++) {
                    dataSave();
                }
            } else if(trackInput === "single"){
                dataSave();
            }        
        } catch (err) {
          console.log(err);
        }
    };

    //Handle change selected 
    const handleChange=(e)=>{
        const {name, checked}= e.target;
        if(name==="allselect")
        {
            const checkedvalue = RadarData.map( (radar)=>{ return {...radar, isChecked:checked}});
            console.log(checkedvalue);
            setRadarData(checkedvalue);
        } else {
            const checkedvalue= RadarData.map( (radar)=>
            radar.id ===parseInt(name)? {...radar, isChecked:checked}:radar);
            console.log(checkedvalue);
            setRadarData(checkedvalue);
        }
    }

    //Handle Track Mode
    const handlerTrackMode=(e)=>{
        const {name ,checked}= e.target;

        const {stat}= e.target.value;


        alert(trackInput+trackMode)
        // if(trackInput === 'single' && trackMode === 'Manual')
        // {
        //     alert("single, manual")
        //     document.getElementById("count").disabled = true;
        // }
        // else if (trackInput === 'single' && trackMode === 'Automatic')
        // {
        //     alert("single, Automatic")
        // }
        // else if (trackInput === 'multi' && trackMode === 'Manual')
        // {
        //     alert("multi, Manual")
        // }
        // else if (trackInput === 'multi' && trackMode === 'Automatic')
        // {
        //     alert("multi, Automatic")
        // }

    }    

    const coba=(e)=>{
       setTrackMode(e.target.value)
    }   


    //Handle delete track
    const handlerGetIdDeleteTrack = async (id) => {
        try {               
            for(let i=0; i < RadarData.length; i++){
                if(RadarData[i].isChecked===true){            
                    checkIdDelete.push(RadarData[i].id);                           
                    console.log(checkIdDelete)
                }
            }
            handlerDeleteTrack()       
        } catch (err) {
            console.log(err);
        }
    }

    //Handler get ID Delete Radar Track Data
    let handlerDeleteTrack = async (e) => {
        let resSend= await fetch(`http://localhost:8080/radar/deleteall`, {
            method: "DELETE",
            body: "["+checkIdDelete+"]",
            headers: {
                'Content-type': 'application/json; charset=UTF-8',
            },               
        });
    }          

    /// REQUEST GET UPDATE
    let handleGetUpdateRadarTrack = async (e) => {
        const {id, checked}= e.target;
        var item = RadarData.find(x => x.id === parseInt(id));
        setRadarUpdate(item)
        const $selectTrackMode = document.getElementById('tmr');
        $selectTrackMode.value = item.trackMode;
        const $selectTrackInput = document.getElementById('ti');
        $selectTrackInput.value = item.trackInput;
        const $selectEnvironment = document.getElementById('er');
        $selectEnvironment.value = item.environment;
        setCount(item.count)
        setEnvironment(item.environment)
        setStartTime(item.startTime)
        setEndTime(item.endTime)
        setCourse(item.course)
        setAltitude(item.altitude)
        setCourseRangeMin(item.courseRangeMin)
        setCourseRangeMax(item.courseRangeMax)
        setSpeedRangeMin(item.speedRangeMin)
        setSpeedRangeMax(item.speedRangeMax)
        setAltitudeRangeMin(item.altitudeRangeMin)
        setAltitudeRangeMax(item.altitudeRangeMax)
        setCourseIncrement(item.courseIncrement)
        setSpeedIncrement(item.speedIncrement)
        setAltitudeIncrement(item.altitudeIncrement)
        setLatitude(item.latitude)
        setLongitude(item.longitude)
        setBearing(item.bearing)
        setDistance(item.distance)
        setMode1Code(item.mode1code)
        setMode2Code(item.mode2code)
        setMode3Code(item.mode3code)
        setMode4Code(item.mode4code)
        setMode5Code(item.mode5code)
        setCount(item.count)
        setId(item.id)
        setSpeed(item.speed)
        console.log(item)
    }

    //Handler get ID Send Radar Track Data
    const handlerGetIdSendTrack = async (id) => {
            try {               
                for(let i=0; i < RadarData.length; i++){
                    if(RadarData[i].isChecked===true){            
                        checkIdSend.push(RadarData[i].id);                           
                        console.log(checkIdSend)
                    }
                }
                handlerSendTrack()       
            } catch (err) {
                console.log(err);
            }
    }

    ///Handle Send Radar
    let handlerSendTrack = async (e) => {
        let resSend= await fetch(`http://localhost:8080/radar/sendtrack`, {
            method: "POST",
            body: "["+checkIdSend+"]",
            headers: {
                'Content-type': 'application/json; charset=UTF-8',
            },               
        });
    }

    return (
    <div className="main-container">   
        <label className="label">RADAR TRACK LIST INFO</label>
        <div className="">
            <div className="track-list">
                <div className="table-wrapper">
                    <table className="scrolldown" >
                        <thead>
                            <tr>
                                <th>TN</th>
                                <th>TI</th>
                                <th>TM</th>
                                <th>Env</th>
                                <th>Course</th>
                                <th>Cmin</th>
                                <th>Cmax</th>
                                <th>Cinc</th>
                                <th>Speed</th>
                                <th>Smin</th>
                                <th>Smax</th>
                                <th>Sinc</th>
                                <th>Alt</th>
                                <th>Amin</th>
                                <th>Amax</th>
                                <th>Ainc</th>
                                <th>BR</th>
                                <th>DN</th>
                                <th>Start</th>
                                <th>End</th>
                                <th>Status</th>
                                <th>Last Send</th>
                                <th>Action</th>
                                <th><input type="checkbox" name="allselect" checked= { !RadarData.some( (radar)=>radar?.isChecked!==true)} onChange={handleChange} /></th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                RadarData.map( (d,i)=>(
                                    <tr key={i}>

                                        <td>{d.id}</td>
                                        <td>{d.trackInput}</td>
                                        <td>{d.trackMode}</td>
                                        <td>{d.environment}</td>
                                        <td>{d.course}</td>
                                        <td>{d.courseRangeMin}</td>
                                        <td>{d.courseRangeMax}</td>
                                        <td>{d.courseIncrement}</td>
                                        <td>{d.speed}</td>
                                        <td>{d.speedRangeMin}</td>
                                        <td>{d.speedRangeMax}</td>
                                        <td>{d.speedIncrement}</td>
                                        <td>{d.altitude}</td>
                                        <td>{d.altitudeRangeMin}</td>
                                        <td>{d.altitudeRangeMax}</td>
                                        <td>{d.altitudeIncrement}</td>
                                        <td>{d.bearing}</td>
                                        <td>{d.distance}</td>
                                        <td>{d.startTime}</td>
                                        <td>{d.endTime}</td>
                                        <td>{d.status}</td>
                                        <td>{d.lastSend}</td>

                                        <td>
                                            {/* <button className="btn btn-sm btn-info me-2">Detail</button> */}
                                            <button className="btn btn-sm btn-primary me-2" id={d.id} onClick={handleGetUpdateRadarTrack}>Edit</button>
                                            {/* <button className="btn btn-sm btn-danger">Delete</button> */}
                                        </td>
                                        <td className="select"><input type="checkbox" name={d.id}  checked={d?.isChecked|| false } onChange={ handleChange }/> </td>

                                    </tr>
                                ))
                            }
                        </tbody>
                    </table>
                </div>
                    <button className="btn btn-primary mb-3" onClick={handlerGetIdSendTrack}>SEND</button>
                    <button className="btn btn-info mb-3" onClick={handlerGetIdSendTrack}>START</button>
                    <button className="btn btn-danger mb-3" onClick={handlerGetIdSendTrack}>STOP</button>
                    <div className="btn-delete">
                        <button className="btn btn-danger mb-3"  onClick={handlerGetIdDeleteTrack}>DELETE</button>
                    </div>

            </div>
        </div>


        <div className="container-list">
        <label className="label">DATA SETTING</label>
            <div className="track-list-1">

                <div className="data-setting">

                        <table className="table-input" >
                            <tr>
                                <td className="id1"></td>
                                <td>Track Input</td>
                                <td>             
                                    <select name="trak-input-radio"  class="form-input" id="ti" onChange={(e) => setTrackInput(e.target.value)} >
                                        <option value="-">-- Pilih --</option>
                                        <option value="single">Single</option>
                                        <option value="multi">Multi</option>
                                        <option value="import">Import</option>
                                    </select>
                                </td>
                                <td>Track Mode</td>
                                <td>
                                    <select  name="track-mode-radio" class="form-input" id="tmr"    onChange={handlerTrackMode,coba } disabled={((trackInput === "") || (trackInput === "-")? true : false)}> 
                                        <option value="-">-- Pilih --</option>
                                        <option value="Manual">Manual</option>
                                        <option value="Automatic">Automatic</option>
                                    </select>
                                </td>
                                <td>Count</td>
                                <td>
                                    <input 
                                    type="number" 
                                    id="count"
                                    name="count"
                                    placeholder="count"
                                    class="form-input"
                                    value={count}
                                    onChange={(e) => setCount(e.target.value)}>
                                    </input>
                                </td>
                                <td><input type="file" id="myfile" name="myfile"></input></td>
                            </tr>

                            <tr>
                                <td></td>
                                <td>Environment</td>
                                <td>             
                                    <select name="environment-radio" class="form-input" id="er" onChange={(e) => setEnvironment(e.target.value)}>
                                        <option value="-">-- Pilih --</option>
                                        <option value="air">Air</option>
                                        <option value="surface">Surface</option>
                                        <option value="subsurface">Subsurface</option>
                                        <option value="land">land</option>
                                    </select>
                                </td>
                                <td>Start Time</td>
                                <td>
                                    <input 
                                    type="datetime-local" 
                                    id="start-time-input" 
                                    name="input-start"
                                    class="form-input"
                                    value={startTime}
                                    onChange={(e) => setStartTime(e.target.value)}>
                                    </input>
                                </td>
                                <td>End Time</td>
                                <td>
                                    <input 
                                    type="datetime-local" 
                                    id="end-time-input" 
                                    name="input-end"
                                    class="form-input"
                                    value={endTime}
                                    onChange={(e) => setEndTime(e.target.value)}>
                                    </input>
                                </td>  
                                <td></td>
                            </tr>

                            <tr>
                                <td></td>
                                <td>Course</td>
                                <td>
                                    <input 
                                    type="number" 
                                    id="course"
                                    name="course"
                                    placeholder="Course"
                                    class="form-input"
                                    value={course}
                                    onChange={(e) => setCourse(e.target.value)}>
                                    </input> deg
                                </td>
                                <td>Speed</td>
